// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

enum BetTakenFor {A, B}

struct Bet {
    address player;
    uint256 oddsA; // 1/odds
    uint256 oddsB; // 1/odds
    BetTakenFor betTakenFor;
    uint256 amount; //in ETH
}

enum GameState {CREATED, OPEN, BETS_CLOSED, FINISHED}

contract Owner {
    address private owner;

    event OwnerSet(address indexed oldOwner, address indexed newOwner);

    modifier isOwner() {
        require(msg.sender == owner, "Caller is not owner");
        _;
    }

    constructor() {
        emit OwnerSet(address(0), msg.sender);
    }

    function changeOwner(address newOwner) public isOwner {
        emit OwnerSet(owner, newOwner);
        owner = newOwner;
    }

    function getOwner() external view returns (address) {
        return owner;
    }
}

contract TheGame is Owner{
    uint256 creationTime;
    uint256 startTime;
    uint256 betsEndTime;
    uint256 closeTime;

    //maybe it's also worth to remember timestamps of updates
    uint256 currentOddsA;
    uint256 currentOddsB;

    Bet[] bets; //maybe it's worth to set a limit for the bets amount

    constructor(uint256 _startTime, uint256 _betsEndTime, uint256 _closeTime) Owner() {
        changeOwner(msg.sender);
        creationTime = block.timestamp;

        // require(creationTime < _startTime);
        // require(_startTime < _betsEndTime);
        // require(_betsEndTime < _closeTime);

        startTime = _startTime;
        betsEndTime = _betsEndTime;
        closeTime = _closeTime;
    }

    function getStartTime() public view returns(uint256) {
         return startTime;
    }

    function getBetsEndTime() public view returns(uint256) {
         return betsEndTime;
    }

    function getCloseTime() public view returns(uint256) {
         return closeTime;
    }

    function getState() public view returns(GameState) {
        uint256 ts = block.timestamp;
        if (ts < startTime)
            return GameState.CREATED;
        else if (ts >= startTime && betsEndTime < ts)
            return GameState.OPEN;
        else if (ts >= betsEndTime && ts < closeTime)
            return GameState.BETS_CLOSED;
        else 
            return GameState.FINISHED;
    }

    //==================================================================

    function updateOddsA(uint256 odds) public isOwner returns(uint256) {
        currentOddsA = odds;
        return currentOddsA;
    }

    function updateOddsB(uint256 odds) public isOwner returns(uint256) {
        currentOddsB = odds;
        return currentOddsB;
    }

    //==================================================================

    function takeABet(BetTakenFor option, uint256 amount) public payable returns(Bet memory){
        //add check of amount and size of payable argument

        Bet memory bet = Bet(msg.sender, currentOddsA, currentOddsB, option, amount);
        bets.push(bet);
        return bet;
    }
}

